// ROLLUP_NO_REPLACE 
 const _20182111JeNeSaisPasPourquoi = "{\"parsed\":{\"_path\":\"/blog/2018-21-11-je-ne-sais-pas-pourquoi\",\"_dir\":\"blog\",\"_draft\":false,\"_partial\":false,\"_locale\":\"\",\"title\":\"Je ne sais pas pourquoi j'écris ceci\",\"description\":\"Et pourtant j'écris, vous l'aurez compris je suis encore une fois dans une phase de réflexion intense.\\nComme tous les jours ? Oui, effectivement. Juste un peu plus.\",\"date\":\"2018-11-21T02:28:28.000Z\",\"author\":\"MarvinL\",\"layout\":\"post\",\"permalink\":\"je-ne-sais-pas-pourquoi\",\"draft\":false,\"categories\":[\"JauneVie\"],\"image\":\"/pictures/2019/07/jo-szczepanska-lCYoIM-fbuU-unsplash.jpg\",\"body\":{\"type\":\"root\",\"children\":[{\"type\":\"element\",\"tag\":\"h1\",\"props\":{\"id\":\"je-ne-sais-pas-pourquoi-jécris-ceci\"},\"children\":[{\"type\":\"text\",\"value\":\"Je ne sais pas pourquoi j'écris ceci\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Et pourtant j'écris, vous l'aurez compris je suis encore une fois dans une phase de réflexion intense.\\nComme tous les jours ? Oui, effectivement. Juste un peu plus.\"}]},{\"type\":\"element\",\"tag\":\"blockquote\",\"props\":{},\"children\":[{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"\\\"Flow of ideas, appears when you start. Don't just seat waiting to them.\\\"\"}]}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Oui je viens d'entendre ceci sortir de ma TV, et c'est \\\"comme par hasard\\\" tombé au bon moment.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Je suis dans une phase de création, je me met au travail, j'exprime mes idées, je crée, j'avance et les choses se passent. Je ne me soucie pas du temps qui passe.\\nJe compte vivre jusqu'a 103ans donc j'ai le temps n'est-ce pas ?\"}]},{\"type\":\"element\",\"tag\":\"blockquote\",\"props\":{},\"children\":[{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Tout arrive au bon moment.\"}]}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Non évidemment, ça ne vient pas de sortir de ma TV. Ce serait trop beau.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Et voila, je viens d'être distrait par je ne sais plus quoi. Mon cerveau dans toute sa splendeur.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Je suis content, les choses se passent. Est-ce que je les imagine mieux ? Oui, certainement ! Je suis un optimiste, ce serait dommage d'imaginer ma vie moins bien qu'elle l'est en réalité non ?\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Je viens d'avoir 26ans et même si j'aurais aimé être indépendant financièrement, nomade, chef d'entreprise, ce n'est pas le cas et j'en suis fier. Certains de mes amis n'avaient pas ce genre d'idées de leur futur a mon age et pourtant sont a un niveau que j'aimerais atteindre. Donc je suis techniquement en avance (même si vous l'aurez compris, \"},{\"type\":\"element\",\"tag\":\"strong\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"le temps n'existe pas\"}]},{\"type\":\"text\",\"value\":\").\"}]},{\"type\":\"element\",\"tag\":\"blockquote\",\"props\":{},\"children\":[{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"\\\"Comment ça le temps n'existe pas ?\\\"\"}]}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Ne t'affole pas ton iWatch ne te mens pas, le temps existe physiquement. Parcontre il ne s'applique à ma vie que de la façon que j'ai choisie. Je ne conçois pas d'être victime du temps (ou de quoi que ce soit en fait), c'est à dire que je laisse pas les éléments temporels classiques influer sur ma vie.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Éléments temporels classiques ? \"},{\"type\":\"element\",\"tag\":\"em\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Parle français toi aussi non ?\"}]},{\"type\":\"text\",\"value\":\"\\nOk je vais vous donner quelques exemples:\"}]},{\"type\":\"element\",\"tag\":\"ul\",\"props\":{},\"children\":[{\"type\":\"element\",\"tag\":\"li\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"25 ans, le quart de siècle, a cet age la tu dois être en fin de cursus scolaire, ou fraichement diplomé, prêt a passer en CDI dans la société de son stage de fin d'étude.\\n\"},{\"type\":\"element\",\"tag\":\"em\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Ai-je besoin d'un exemple numéro 2 ?\"}]}]},{\"type\":\"element\",\"tag\":\"li\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Bientôt 8 ans de relation, vous habitez ensemble, vous avez tous les deux plus de 25ans et une vie plutôt bien remplie. Ça y est il est temps de se marier. PIRE, c'est LE moment d'avoir un enfant.\"}]}]},{\"type\":\"element\",\"tag\":\"h1\",\"props\":{\"id\":\"non\"},\"children\":[{\"type\":\"text\",\"value\":\"Non\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Tout simplement non.\\nPourquoi ? Comment ça pourquoi ?\\nEst-ce que je veux être vieux quand mes enfants atteindront 18ans ?  Je ne me pose pas ce genre de question. Je veux être en vie et heureux.\\nEt si vous avez bien lu, je veux vivre jusqu'a 103ans, donc même si je fais mes enfants a 80ans je serais capable de féter leurs 18ans \"},{\"type\":\"element\",\"tag\":\"em\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"(j'ai bien fait le calcul ? Il est 2H13 soyez indulgents)\"}]},{\"type\":\"text\",\"value\":\".\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Bref j'ai un peu perdu le fil de pensée initial de cet article, vous l'aurez compris ce n'était rien de structuré.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Je suis en congés pour le première fois de ma vie, à 26ans.\\nQui connaissez vous qui puisse en dire autant ?  Ah vous ne le retenez pas ça, mais que untel en soit à son 3ème gosse alors qu'elle n'a même pas de voiture, ça vous savez.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Je donne le temps au temps les gars, vraiment. Tant que je me réveille le matin, que tous mes membres fonctionnent et que ma femme respire à côté de moi, je suis content, reconnaissant.\\nQuand je dis femme, je me comprends je vous l'expliquerai dans un autre article. (Non je n'ai pas fait ma demande calmez vous, et relisez l'article).\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Je suis reconnaissant, pour le temps que cet univers m'accorde et j'en profite autant que je peux.\\nJe ne laisserais pas la pression sociale, dicter mes agissements au dépit de mon bonheur. J'en parlais dans des tweets plus tôt dans la soirée.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"On est comme des crabes dans un panier. Meme sans couvercle, \"},{\"type\":\"element\",\"tag\":\"em\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"\\\"sky is the limit\\\"\"}]},{\"type\":\"text\",\"value\":\", aucun d'entre nous ne réussirais à sortir de ce panier, si il se laissait tirer vers le fond par ses pairs. Et si l'allégorie est trop compliqué pour vous.\\nVous êtes les crabes qui pourrons aller jusqu'à blesser leurs semblables parce qu'ils pensent différemment, osent, tentent et assument leurs choix non standards.\\nAttention à l'impact que vous pouvez avoir sur votre entourage. Même ce que vous pensez dire en blaguant peut avoir une consonnance négative et impactante sur la vie d'autrui.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Bref je crois que cet article n'a plus trop de sens, et vous savez déjà,  je ne vais pas le relire avant de le poster.\\nCar telle est ma misson : \"},{\"type\":\"element\",\"tag\":\"em\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"#JWI\"}]}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"J'attends vos commentaires, retours et avis. Et si vous voyez des fautes ou des phrases inachevées dites le moi ahah.\"}]}],\"toc\":{\"title\":\"\",\"searchDepth\":2,\"depth\":2,\"links\":[]}},\"_type\":\"markdown\",\"_id\":\"content:blog:2018-21-11-Je-ne-sais-pas-pourquoi.md\",\"_source\":\"content\",\"_file\":\"blog/2018-21-11-Je-ne-sais-pas-pourquoi.md\",\"_stem\":\"blog/2018-21-11-Je-ne-sais-pas-pourquoi\",\"_extension\":\"md\"},\"hash\":\"Uul9QMMKms\"}";

